INSERT INTO `book_achievement` VALUES (41, '2016年入职中化后，主要进行了：一、每天坚持做2-3页PPT ,2年时间独立开发的业务员培训课件，主要有：«苹果栽培技术»、«猕猴桃栽培技术»、«辣椒病虫害综合防治»、«肥料基础知识»等。二、独立开展完成试验示范8个，涉及猕猴桃、葡萄、药材、蔬菜等，涉及中化系列产品。三、开展业务员定期培训5场次，受训业务150人次，另外一对一培训3人次，对提高业务员的业务水平有很大帮助。四、独立完成召开农民会和客户招商会议的各种课件10余个，涉及小麦、玉米、蔬菜、药材、果树等各个领域，召开农民会议30场次，参会农民2800人次，为中化系列肥料的推广与使用做出了有益的工作。五、开展种田大户的施肥管理方案。例如：华州万丰1500亩小麦的施肥管理方案，使过去不足500公斤的产量，在2017-2018年度，在晚播、倒春寒、低温寡照的不利条件下，在灾害年份平均单产达到590公斤，受到合作大户的好评。六、进行农户田间跟踪指导，解决农户施肥、病虫害防治、综合管理技术措施，受益农户200多户', 231, 1, NULL);
INSERT INTO `book_achievement` VALUES (42, '张卫峰, 贾冲冲. 一种玉米种肥同播配方施肥机（ZL 2014 2 0795593.0）', 213, 1, NULL);
INSERT INTO `book_achievement` VALUES (43, '获得国家授权发明专利9项；制定化工行业标准1项。\n    2002 年在华南农业大学组建、申报和获准了我国农业院校第一个肥料学博士点。在国内率先提出“以控释肥料物化平衡施肥理论和平衡施肥技术”的理论；研发了环保高效低成本包膜材料、包膜缓/控释肥料和脲醛缓释氮肥制造技术及配套施用技术。\n    研发的控释肥料制造技术，特别是无溶剂原位表面反应成膜控释技术、水基聚合物原位成膜控释技术首先被施可丰化工股份有限公司采用，建设了33条自动控制控释肥料包膜生产线，迄今该项控释肥料产业化技术已经被9个大型化肥企业采用，实现了大规模的包膜控释肥料产业化，2008年以来，控释配方肥产销430 多万吨。在以企业（施可丰）为纽带，政府部门（农业部、生农业厅）指导，用户为服务对象的推广应用原则指导下，产品推广应用于广东、广西、海南、湖南、黑龙江、辽宁等15 省(区)的玉米、棉花、苹果、大豆、马铃薯、蔬菜、香蕉、菠萝等大田粮食、经济作物和果树，推广应用面积累计7600多万亩。该项控释肥料和控释配方肥料技术已列为农业部今后推广的测土配方施肥技术。 \n    在国内首个提出并成功研发植物油包膜控释肥料产业化技术、首个提出并成功研发了改良酸性土壤的碱性氮磷钾复合肥、首个提出并成功研发了长效液体复合肥。 ', 214, 1, NULL);
