INSERT INTO `book_achievement` VALUES (239, '发明专利：\n用湿法磷酸制备工业级磷酸、食品级磷酸和工业磷酸一铵的方法（专利号200710092904.1）、一种磷酸三丁脂的再生工艺（专利号201010546968.6）、一种化学石膏制硫铵反应料浆浓缩和余热余氨回收方法（专利号201310167981.4）、一种水溶性聚磷酸铵生产中使用的中和装置（专利号201510393324.0）、一种磷矿助磨剂及其制备方法（专利号201210505108.7）、一种多元素硝基复合肥生产方法（专利号201210505122.7）、一种湿法磷酸净化淤渣生产多元硝基复合肥的方法（专利号201310069651.1）、一种湿法磷酸溶矿工艺（专利号201310314912.1）、一种用高镁磷尾矿制备氢氧化镁的方法（专利号201410085908.7）、生产结晶状磷酸二氢钾和硝酸钾大量元素水溶肥的方法（专利号201410474331.9）。\n', 189, 1, NULL);
INSERT INTO `book_achievement` VALUES (240, '实用新型专利：\n湿法净化磷酸生产磷酸二氢钾的装置（专利号：20102063312.4）、一种奥斯陆结晶器（专利号201220220109.2）、一种磷铵淤渣生产硝基复合肥装置（专利号201420511650.8）、生产水溶性聚磷酸铵的中和装置（专利号201520483623.9）、\n聚合釜（专利号201220611049.7）。\n\n', 189, 1, NULL);
INSERT INTO `book_achievement` VALUES (241, '技术方案、报告：\n（1）氟硅酸钠母液净化及应用研究项目总结及实施方案；\n（2）硫磷混酸结晶法MCP小试实施方案；\n（3）硫磷混酸法结晶MCP技术报告；\n（4）复合肥生产自动化控制技术与应用研究方案；\n（5）低聚磷酸铵中试装置建设方案及总结；\n（6）10万吨/年CO2矿化磷石膏示范装置建设技术方案及可研报告；\n（7）高浓度CO2矿化磷石膏工业扩试研究报告；\n（8）多元素生理酸性肥料生产关键技术验收报告；\n（9）湿法磷酸净化及工业磷铵试车方案、操作规程等；\n（10）5万吨/年精制湿法磷酸产业化可行性研究报告；\n（11）水溶肥装置建设方案；\n（12）磷石膏低温转化制硫酸试验方案及总结。\n\"\n', 189, 1, NULL);
INSERT INTO `book_achievement` VALUES (242, '山东肥业工作期间，参与或负责：\n1、2013-2015年，参与《渤海粮仓》国家项目，协调总部与生产、销售工作，试生产三个批次试验肥一百余吨，示范肥近千吨；\n2、2011年，参与《高塔脲醛肥》等项目研发，开发稀溶液法合成脲醛工艺。2014年后，进行26-12-12、26-10-12等品规高塔脲醛肥生产，已累计生产1万余吨。\n3、2012年，参与《包膜缓释肥新技术开发》等项目，重点开展包膜溶剂防酸化腐蚀、再生料替代等工作，当年获得肥业精益管理项目奖。\n4、2013-2014年，作为负责人之一，参与《萃取结晶法硫酸钾产业化开发关键技术研究》项目，进行萃取结晶法硫酸钾产业化开发，并参与3万吨/年硫酸钾装置建设，2013-2015年，共生产硫酸钾4万余吨，盈利千万余元。\n5、2015年，参与《伴能添加蓝力士复合肥产品升级研发》项目，协调沈阳化工研究院，使伴能在肥料中的保留率超过70%，累计生产千余吨产品。\n6、参与公司其他相关新产品的开发，如高塔全水溶产品的开发，氨基酸螯合肥开发、腐殖酸活化等项目，累计生产相关产品数万吨。\n', 190, 1, NULL);
INSERT INTO `book_achievement` VALUES (243, '临沂研发中心工作期间，参与或负责：     \n1、脲醛技术及产品开发：作为项目经理，带领缓释肥团队，进行浓溶液法脲醛合成工艺研发，并在山东肥业、长山等企业转化，截至目前，已累计生产相关产品二十余万吨，大大提高了公司产品内外观质量，并基于此，进行侧深施肥等产品开发，满足机械化施肥需求，产品效果受到市场的肯定。\n2、稳定性肥料开发：作为项目经理，带领团队开展抑制剂筛选工作，并开发M50稳定性肥料产品，通过大量试验示范表明，在玉米等作物上应用效果良好，减肥增效明显，是公司重点差异化产品之一，已累计转化约6万吨。\n3、作物专用肥开发：带来缓释肥项目团队，基于缓释技术，集成多种因子，开发玉米、小麦、水稻等减肥增效产品，如玉米免追肥产品、小麦减肥增效及免追产品、水稻侧深施肥专用肥、再生稻专用肥等产品开发，部分产品已上市，并取得良好的市场反馈，在研项目也在顺利进行中。\n4、积极参与国家项目实施，重点参与《两减项目》、《粮丰—稻作项目》等多个项目的实施工作，并申请《粮丰—再生稻》项目。\n目前目前累计负责或参与各类科研项目约16项，大多获得了良好的效果。其中国家项目3项，公司级科研项目13项。\n\n', 190, 1, NULL);
INSERT INTO `book_achievement` VALUES (244, '专利及论文\n1、不同吸镉能力油菜各器官累积镉的差异2009《中国油料作物学报》\n2、Can Cadmium Uptake by Chinese Cabbage be Reduced After Growing Cd-Accumulating Rapeseed?2010《PEDOSPHERE》\n3、滴灌条件下含螯合态微量元素的复合肥对马铃薯生长、产量及养分利用率的影响2015《马铃薯产业与现代可持续农业》\n4、一种脲甲醛腐植酸复合肥生产工艺2018《磷肥与复肥》\n5、授权专利：一种氨酸法直接造粒生产有机螯合型复合肥料的工艺  \nZL201310001794.9\n6、授权专利：一种喷浆生产有机螯合型多元复合肥料的工艺\nZL201310001791.5\n7、正在申请专利（实质审查）：\n7.1一种低温浓溶液法直接造粒生产脲甲醛缓释复合肥的方法\nCN201611218716.4\n7.2一种高塔双效抑制剂型玉米稳定性专用肥料及生产方法\nCN201611219865.2\n7.3一种制备含有微胶囊型肥料增效剂的复合肥的方法及其制得的复合肥\nCN201610644389.2\n7.4一种喷浆法生产高钾型硝基肥的工艺CN201410380283.7\n7.5一种稀溶液法制取脲醛缓释肥的工艺CN201410235197.7\n7.6一种用于肥料的生物-光双功能降解缓释膜的制备方法\nCN201410380356.2\n7.7一种玉米专用的可降解包膜BB肥CN201410190054.9\n四、成果鉴定\n1、《包膜缓释肥新工艺技术开发》 2011 国内领先\n2、《萃取结晶法硫酸钾产业化开发关键技术研究》 2015 国内先进\n3、《一种直接造粒生产有机螯合型复合肥的工艺》 2015 国内先进\n\n\"\n', 190, 1, NULL);
