INSERT INTO `book_achievement` VALUES (252, '研发类：\n1、主持完成红日阿康水泥缓凝剂研发，未能产业化。\n2、参与完成施可丰大量元素粉状水溶肥配方研发，共完成6个配方的研发，2017年完成销售300吨左右。\n3、主持完成施可丰液体水溶肥5个配方的研发，2017年完成销量3000吨左右。\n4、主持引进项目，海藻提取物的研发及生产，试产10吨。\n5、主持完成完成液体EDTA-Zn的研发，试生产1吨。\n5、参与临沂农业研发中心核心母粒项目，指导完成3个核心母粒配方研发，进行中。\n6、主持功能性水溶肥项目，完成试验方案制定，试验准备，目前试验进行中。\n7、主持负责腐植酸活化及盐碱地肥料研发工作，进行中。\n8、参与复合肥产品质量提升，参与完成相关质量标准的制定，初步完成喷浆造粒改造讨论稿。\n9、参与水溶肥产品质量提升，进行中。\n', 186, 1, NULL);
INSERT INTO `book_achievement` VALUES (253, '项目类：\n1、参加红日阿康10万吨甲醇项目建设，主要作为项目负责人，负责其中的盐酸灌区建设和6MW背压式汽轮机项目建设，顺利完成相关工作，一次性开车成功。\n2、全面负责红日阿康20万吨建筑石膏粉项目建设，一次性开车成功，产能达到设计要求，产品质量复合相关国家标准。\n3、负责红日阿康40万吨硫磺制酸低位热能前期工作。\n4、完成施可丰粉体水溶肥及液体肥料项目建设，海藻肥设备安装及试生产。\n\n', 186, 1, NULL);
INSERT INTO `book_achievement` VALUES (254, '技改类：\n1、主持完成红日阿康，35吨沸腾流化床锅炉脱硫项目，但未能很好的完成相关工作。\n2、参与完成红日10万吨合成氨项目，增设两台造气炉改造，顺利完成，满足相关要求。\n3、参与完成红日阿康15万吨/年氨化改造，接手较晚，完成最终的项目建设及试车。\n4、主持完成红日阿康，复混肥车间新增袋式除尘器改造，达到设计指标，运行正常。\n5、主持完成循环水泵节能改造等等。\n6、主持完成红日阿康机泵变频改造项目，运行正常。\n7、主持完成红日阿康功率因数改造项目，运行正常。\n8、主持完成红日阿康磷酸磨机改造项目，运行正常。\n9、主持完成红日阿康磷酸脱氟项目。\n10、参加红日阿康合成冷排改空冷器改造。\n', 186, 1, NULL);
