INSERT INTO `book_achievement` VALUES (339, '作为主要成员参与免提DNA的直接PCR和多重PCR检测体系建设，将SSR分子检测效率提升一倍，日均检测量可达6000-8000水稻单株，产生约20000-30000个数据点；目前仍是分子标记检测的核心技术机密之一\n', 134, 1, NULL);
INSERT INTO `book_achievement` VALUES (340, '在日常检测中精益求精，带领团队成员一起创新“种子检测体系”，将一个水稻种子纯度样品的检测时间由原来的10个工作日减少至1-2个工作日，并降低成本20-30%，将水稻种子纯度检测效率提升至一个新的平台\n\n', 134, 1, NULL);
INSERT INTO `book_achievement` VALUES (341, '分子标记对加快番茄育种选择进程、提高育种效率、助力推进公司番茄品种商业化进程有至关重要的作用。近两年自主研发出12个番茄抗病虫性状的功能分子标记（Production Marker），可检测目前番茄育种过程中主效的抗病虫基因，公司近两年新研发并推广的品种华锦1号、华锦2号、华锦9号、6716和7686等都是通过分子标记聚合抗病基因而打造出的优良番茄品种\n', 134, 1, NULL);
