INSERT INTO `book_achievement` VALUES (436, '主要参与中种玉米转化体系搭建，申请《一种玉米骨干自交系的高效转基因方法》：排名第三，2017年12月授权。效果/效益：建立中种玉米转化平台并使之角逐行业领先地位，推动内部转基因事件研发、实现技术服务创收', 165, 1, NULL);
INSERT INTO `book_achievement` VALUES (437, '牵头新基因型玉米培养体系优化工作，申请《用于培育转基因玉米的培养基及培养方法》：排名第二，2017年8月公开。效果/效益：对包括安于母本在内的多个玉米新基因材料具有高效且广适性的转化培养能力，经2017-2018年转化技术升级项目中的多个材料验证', 165, 1, NULL);
INSERT INTO `book_achievement` VALUES (438, '参与公司“抗虫耐除草剂”系列项目的转基因玉米事件创制和玉米改良新方法探索，与上下游申请《抗虫抗除草剂转化事件及其创制方法和检测方法》和《利用CRISPR/Cas9系统对玉米基因定点突变的方法》 ：均已公开。效果/效益：推进ZZ030等转基因玉米事件创制、“科技部—利用转基因技术培育玉米抗虫耐除草剂新种质”项目顺利结题；为实现对玉米基因组的定点突变，提供玉米改良新方法\n', 165, 1, NULL);
INSERT INTO `book_achievement` VALUES (439, 'SOP文件编制与升级管理：2013年本人向部门领导提出建议并主要负责组织制定一套关于玉米幼胚转化的标准作业流程（SOP）文件，并将SOP文件管理理念在水稻转化团队例会分享。组织拟制的9份经国际ETS审计认定的SOP文件（中英文两版），是其中涉及玉米幼胚转化主要培养流程的技术创制牵头人，并在期间不断优化流程、更新SOP版本，CSWI009、CSWI010已更新到4.0版以上。\n\n', 165, 1, NULL);
