INSERT INTO `book_achievement` VALUES (451, '中化集团项目子课题-水稻智能测配模型（CB）：测配环节是产品产出的关键步骤，但实际能测配的规模有限，育种家凭经验挑组合测试。因此，以利用有限资源提升测配产出、实现精准测配为首要目标，设计项目路线，带领团队设计开发了水稻智能测配模型，提高测配成功率，目前可提高组合产量达标率22%（产量达标指产量超出对照丰两优4号3%以上）。目前，利用该模型指导的测配组合的亲本已经完成扩繁，将于今年海南测配\n', 118, 1, NULL);
INSERT INTO `book_achievement` VALUES (452, ' 水稻转化难度预测模型：由于新水稻品种转化难易度差异大，难以提前合理安排基因编辑计划，因此带领团队设计并搭建了基于基因组信息的数学模型提前预测转化难易度，准确度80%以上，实现提前安排预测难转化品种的编辑工作计划\n', 118, 1, NULL);
