INSERT INTO `book_achievement` VALUES (476, ' 国内首先筛选出（国内未见报道）抗南方黑条矮缩病的基因资源（抗性明显超出鉴定单位中抗对照），完成定位工作（目前国内仍未见报道），并开发分子标记用于抗性品系选育，选育了一批抗性株系。相关技术报告已完成。该成果应用有望选育出抗南方黑条矮缩病的优良品种，在华南市场形成明显的竞争优势（国内尚无抗南黑抗性品种）\n', 124, 1, NULL);
INSERT INTO `book_achievement` VALUES (477, ' 国内率先利用全基因组技术等育种方法（国内在国际上领先），选育中芯1B等多个具备抗性稻瘟病、褐飞虱抗性的水稻新品种，申请新品种保护。其中20个作为主要完成人已获得授权，包括13个恢复系、2个两系不育系及1个三系保持系、2个三系不育系等所有杂交水稻亲本类型。另有一批品种保护权申请获得受理\n', 124, 1, NULL);
INSERT INTO `book_achievement` VALUES (478, '创制绿色多抗水稻亲本，育成了聚合褐飞虱抗性基因、稻瘟病抗性基因、白叶枯抗性基因、及南方黑条矮缩病性基因和米质、香味的优异水稻中香A（Bph14\\Bph15\\Xa23\\Pi1\\Pi2）,中盛A（Bph14\\Bph15\\ Pi1\\Pi2），中95A（Bph14\\Bph15\\ Pi1\\Pi2），岳恢9113（Bph14\\Bph15\\ Pi1\\Pi2），中种恢629（Bph14\\Bph15\\Xa23\\Pi1\\Pi2），龙s（Wx\\Bph15\\ Pi1\\Pi2）,U25(南黑基因（（Bph14\\Bph15\\ Pi1\\Pi2））及一批含4个及以上抗性基因的中间材料。该批水稻亲本和资源的利用，有望打造中种绿色品种，在生产中少使用农药，对中化MAP战略的实施甚至全社会都具有重大意义\n', 124, 1, NULL);
