INSERT INTO `book_achievement` VALUES (542, '2）提出我国化肥“质量替代数量发展”、构建国家绿色肥料体系（绿色原料、绿色制造、绿色产品、绿色流通、绿色施用）产业战略，被学术界、产业界和政府广泛认同和接受，为新时期推动我国肥料产业升级提供了战略思路。', 212, 1, NULL);
INSERT INTO `book_achievement` VALUES (543, '3）创建了“肥效反应法”和“农田土壤养分综合平衡法”制定作物区域专用复合肥配方的理论与方法，为我国复合肥料配方专用化、区域规范化和科学化提供了理论和方法支撑。', 212, 1, NULL);
INSERT INTO `book_achievement` VALUES (544, '4）开创了利用微量生物活性有机增效载体与化学肥料科学配伍开发绿色高效肥料产品的新途径，突破了绿色高效肥料大产能、低成本技术短板，为我国化肥产品绿色转型升级提供了创新技术途径，开拓增值肥料新产业；发明的锌腐酸尿素、海藻酸尿素和禾谷素尿素以及锌腐酸/海藻酸磷铵、锌腐酸/海藻酸复合肥等系列增值肥料新产品，在国内40多家大型企业实现产业化，产能超过2000万吨。', 212, 1, NULL);
INSERT INTO `book_achievement` VALUES (545, '5）主编出版著作20余部，发表学术论文200多篇，获得26项国家发明专利授权，主持制定企业/行业相关标准40余项。', 212, 1, NULL);
