INSERT INTO `book_achievement` VALUES (552, '1981年以来，长期从事杂交水稻高产高效栽培研究，先后主持和参加国家“863”、“973”、国家科技支撑计划、农业部重大专项等重大科研项目20多项，形成了杂交水稻高产栽培独具特色的学术风格，研创了杂交水稻高产栽培、三熟制双季稻高产栽培等技术成果和技术体系，在大面积上推广应用产生了巨大的社会、经济效益 \n', 44, 1, NULL);
INSERT INTO `book_achievement` VALUES (553, '近10年来，结合国际国内新形势，勇于创新，他创立了以高产栽培技术为基础的“杂交水稻产业技术联盟”科企合作新模式，创造性地开展了超级杂交稻节氮高效栽培、抗倒高产栽培等方面的研究，取得了重大研究进展，形成了配套的技术体系，淀积了深厚的专业基础，学术造诣较深，在国内外专业杂志上以第一作者发表中、英文研究论文80余篇，主编和合著出版了中、英文著作5部。先后获国家、省部级科技奖励10多项。其中，国家科技进步二等奖1项，省级科技进步1等奖3项、2等奖5项。获政府嘉奖12次 \"\n', 44, 1, NULL);
INSERT INTO `book_achievement` VALUES (554, '出版学术著作12部，其中主编《小麦的穗》（2008年）主编《小麦高产与防灾减灾技术》（2016年）等；发表论文199篇，在《作物学报》发表“高产麦田氮素利用、氮平衡及适宜施氮量”（2008年）等。\n', 45, 1, NULL);
