INSERT INTO `book_achievement` VALUES (557, ' 长期从事分子生物学和生物技术研究，在Plant Journal，Molecular Breeding等著名杂志发表论文多篇。', 158, 1, NULL);
INSERT INTO `book_achievement` VALUES (558, '2011年加入中国种子集团有限公司生命科学技术中心, 从事转基因玉米、水稻研发工作， 带领的分子实验室团队参与创制多个高抗螟虫和除草剂的水稻和玉米转基因事件，其中一个优质玉米转基因事件ZZM030进入生产性试验，预计明年可获得转基因安全证书，共计申请发明专利17项，其中国际专利1项\n', 158, 1, NULL);
INSERT INTO `book_achievement` VALUES (559, '主持中化-英国利兹大学国际合作项目一项（经费450万元），获得2个高抗线虫的转基因棉花事件，已申请专利保护； 参与国家重点研发计划课题 ---主要农作物染色体细胞工程育种/2016YFD0102000 （经费80万元），研发可诱导单倍体的水稻材料，目前已获得一大批相关基因的突变体，正在测试其单倍体诱导能力。\n', 158, 1, NULL);
INSERT INTO `book_achievement` VALUES (560, '带领团队积极跟进基因编辑前沿技术， 很快在科技中心建立了相关的技术体系，于2015年组织和筹建科技中心的基因编辑部，专门从事基因编辑技术的研发，并担任基因编辑部总监。', 158, 1, NULL);
INSERT INTO `book_achievement` VALUES (561, '基因编辑团队成立3年多以来， 建立了高效的基因编辑体系， 包括单碱基替换编辑技术和knock-in编辑技术，并成功将这些技术用于水稻育种， 对20多个优良亲本进行米质、粒型、抗性、株型等性状进行定向改良，效果显著， 一批改良的亲本已进入测配流程。  ', 158, 1, NULL);
