INSERT INTO `book_achievement` VALUES (587, '2014年，在玉米品种推广过程中，对赤峰地区农华106种植户进行种植技术指导，通过确定最佳播期，最佳种植密度及合理的化肥用量和用法，使得种植户亩产量普遍提高200到300斤。\n2015年和2016年在黑龙江宾县地区，进行大面积玉米种植示范，通过缓释尿素的运用，在肥料成本不增加的情况下，配合相应的耕作措施，亩产量提高200左右，并且品质（容重）方面面有很大的提高。', 61, 1, '');
