INSERT INTO `book_achievement` VALUES (682, '2003年7月，完成掺混肥料潮解技术攻关：1、氯基掺混肥料，禁止选择颗粒普钙作为母粒填充；2、氯基掺混肥料母粒生产，控制原材料过磷酸钙用量≤200kg；避免每年因为掺混肥料潮解给公司带来80余万元的损失。', 57, 1, '');
