INSERT INTO `book_achievement` VALUES (687, '参编专业书籍5本：《中国化肥产业技术与展望》、《中国磷肥产业竞争力项目》、.《中国肥料实用手册》、《东北沙地与生态建设》 、《农业生产中的控释与稳定肥料》\n', 87, 1, '');
INSERT INTO `book_achievement` VALUES (688, '专业论文： 第1作者学术论文5篇，第2作者12篇。《中国钾资源及钾肥发展战略》、.《中国肥粮比价及调控策略初探》、《硝化/脲酶抑制剂在农业中的应用》等现代化工、经济研究参考、植物营养与肥料学报、土壤学报等核心刊物，行业研究、缓控释肥料产品研发和大田试验数据等 。\n', 87, 1, '');
INSERT INTO `book_achievement` VALUES (689, '2004年3月，完成有机-无机复混肥料“粉化”项目攻关：以纤维类（牛粪、猪粪、草炭、风化煤等）有机肥料为有机原料的产品，尿素用量控制≤80kg；避免每年因为产品粉化带来的经济损失近70万元。', 57, 1, '');
INSERT INTO `book_achievement` VALUES (690, '2007年4月，完成以纤维类有机肥料为主要原材料的颗粒有机肥成粒性攻关：对于纤维类有机肥料的成粒选择以毛发、羽毛生产氨基酸的有机物废渣为粘结剂，解决转鼓、圆盘造粒问题。解决中化无颗粒有机肥的历史。', 57, 1, '');
INSERT INTO `book_achievement` VALUES (691, '2013年8月，《一种修复土壤重金属污染的生物有机肥料研发》本项目将主要研究驯化和筛选高效菌株，构建菌种库；优化功能微生物组合修复技术，选用优质的微生物菌种和组合，生产高性能的能够修复土壤重金属污染的生物有机肥料。项目经费88.6万元。申请“一种能够钝化土壤重金属的生物有机肥料”专利，专利号201310324576.9；《农业管理节水技术及其发展趋势探讨》发表在《中国农业信息》2013年第23期', 57, 1, '');
INSERT INTO `book_achievement` VALUES (692, '2013年10月申请“一种沼液制取高效有机-无机复混肥料的方法”，专利号201310543808.X。', 57, 1, '');
INSERT INTO `book_achievement` VALUES (693, '2013年10月，《一种适用于橡胶的功能性肥料的开发与推广》本项目研究的内容主要是开发出适用于橡胶专用的功能性肥料及其产业化技术。在项目实施过程中，将有效利用中化东方现有生产技术和条件基础，开发含功能性元素的优质橡胶专用肥料，延伸中化化肥现有产品线，解决橡胶种植瓶颈问题，促进我国橡胶产业的大力发展。项目预算60.7万元，2014年6月完成项目结题。完成肥料的研发、试生产、推广性销售。申请“一种橡胶树专用肥料及其制备方法”，专利号201410087074.6”；发表《有机无机肥对橡胶人工林土壤脲酶活性的影响》在《中国农业信息》申请“一种沼液制取高效有机-无机复混肥料的方法”，专利号201310543808.X。', 57, 1, '');
INSERT INTO `book_achievement` VALUES (694, '2017年11月，在枝江市百里洲开展“小农户与现代农业有机衔接”项目试点：2017年11月-2018年5月，3700亩马铃薯示范农场的从种到销的经营与管理。', 57, 1, '');
INSERT INTO `book_achievement` VALUES (695, '2018年6月-2018年10月，13000亩夏玉米示范农场的从种到销的管理。百里洲的探索，为公司MAP业务的定位提供了一定的参考价值。', 57, 1, '');
INSERT INTO `book_achievement` VALUES (696, '无', 223, 1, '');
