INSERT INTO `book_achievement` VALUES (698, '1. Hou X B, Liu Y H, Xiao Q L, Wei B, Zhang X G, Gu Y, Wang Y B, Chen J, Hu Y F, Liu H M, Zhang J J, Huang Y B. Genetic analysis for canopy architecture in an F2:3 population derived from two-type foundation parents across multi-environments. Euphytica, 2015, 205: 421-440', 167, 1, '');
INSERT INTO `book_achievement` VALUES (699, '1.	Jiang Haichao, Hu Jie, Li Zhi, Liu Jia, Gao Guanjun, Zhang Qinglu, Xiao Jinghua, He Yuqing. Evaluation and breeding application of six brown planthopper resistance genes in rice maintainer line Jin 23B. Rice, 2018, 11:22 (IF: 3.7)', 129, 1, '');
INSERT INTO `book_achievement` VALUES (700, '担任技术创新部遗传编辑团队经理，负责具体研发任务实施及产品流水线统筹管理，本团队目前拥有博士7人、硕士4人，大专1人。', 150, 1, '');
INSERT INTO `book_achievement` VALUES (701, '2018年10月下旬在《南方农业》杂志上发表《直播稻田化学除草困难的原因及防除对策》文章。', 54, 1, '');
INSERT INTO `book_achievement` VALUES (702, '溃疡病的综合防治，在坤水农业猕猴桃基地指导实施的猕猴桃溃疡病的综合防治方案，通过合理施肥，增强猕猴桃春季新根快速生长，健壮树势，严格控制全年氮肥施用量，辅助化学预防（春雷霉素、氢氧化铜）溃疡病，合理负载保存树体综合实力。在邛崃火井镇、水口镇、南宝山镇高海拔区域达到了很好的效果。坤水农业全园600亩猕猴桃，经过2018年一年多的示范推广，2019年园区溃疡病发病率为6%。与周边区域猕猴桃基地平均发病率20%相比，为坤水农业猕猴桃基地挽回经济损失50万元。', 40, 1, '');
INSERT INTO `book_achievement` VALUES (703, '1、红提葡萄串型的“两型修剪”：提高果品的商品性，增产10%', 177, 1, '');
