INSERT INTO `book_achievement` VALUES (720, '8. 精细定位了水稻新质源恢复基因RR-FA。承担的博士后项目“水稻新质源恢复基因克隆及功能研究”获得武汉市博士后项目启动经费支持，通过两年研究初步确定了目的基因RF-FA', 129, 1, '');
INSERT INTO `book_achievement` VALUES (721, '在首席科学家马崇烈博士的指导下，带领团队将国际先进的基因编辑技术产业化，成功建立了基于基因编辑技术的水稻种质创新及定向改良产品线。在这条产品线上，我们每年可以生产上万份水稻编辑材料，截止目前，我们改良的水稻品种超过50个，涉及的基因超过40个，香味、粒型、株叶形、糯性等性状都已经能够大规模商业化应用。', 150, 1, '');
INSERT INTO `book_achievement` VALUES (722, '已经成功交付给育种家27个改良品种进行测配，将传统的定向改良时间缩短至两年左右，逐渐摸索出一条适合商业化的基因编辑技术标准及流程，为公司节约了大量的时间成本及研发成本。', 150, 1, '');
INSERT INTO `book_achievement` VALUES (723, '根据市场导向，选择市场需求大的重要农艺性状进行深入研究，如米质、抗除草剂、单倍体诱导系等，这些优异性状的利用，势必增加产品中的科技附加值，具有更高的市场适应力及潜力，能够为企业创造极大的商业价值。', 150, 1, '');
