INSERT INTO `book_project` VALUES (89, 181, '国家公益性行业科研专项', ' 公益性行业 (农业) 科研专项经费 － 芒果产业技术研究与示(201203092 －4 － 3)', '100', '10', '在校参与导师课题研究示范', '第一作者发表《杧果生育期叶片及果实矿质元素变化规律研究》（通过对海南省乐东县“台农芒1号”生育期叶片及果实中9中矿质元素含量进行跟踪分析，研究叶片及果实养分含量变化及相关性。）；第一作者发表《土壤施钙对芒果果实钾、钙、镁含量及品质的影响》（以“台农1号”芒果为试材，田间试验研究了花前土施不同用量硝酸钙对芒果果实钾、钙、镁含量及产量、品质的影响。）；第一作者发表《叶施硝酸钙对芒果钾、钙、镁含量及品质的影响》（研究叶面施用硝酸钙对芒果钾、钙、镁含量及品质的影响，为钙肥在芒果生产中的合理应用提供理论依据）。', 1, '');
