INSERT INTO `book_project` VALUES (205, 58, '示范推广类', '绿色超级稻新品种种子生产与试验示范', '200', '15', '将绿色超级稻大项目中各子课题育成的新品种、新组合在全国不同生态区进行制种和多点试验示范。本人参与项目的任务分解、经费分解，协调各区域绿色超级稻新品种的展示、示范与推广计划和执行；负责湖北和海南的绿色超级稻品比试验和展示。', '绿色超级稻新品种种子生产技术标准', 1, NULL);
INSERT INTO `book_project` VALUES (206, 58, '技术集成类', '农作物新品种规模化测试体系及基地建设', '1000', '16', '该项目工作内容为以农作物新品种标准化测试体系建设和种子基地建设为核心，以需求为基础，形成高效、精准和共赢的农作物新品种测试体系的良性发展模式。本人参与玉米测试网点建立和玉米新品种（组合）评价。', '玉米测试网点建立技术标准、玉米新品种评价标准', 1, NULL);
