INSERT INTO `book_project` VALUES (214, 209, '国家支撑计划项目', '《杂交水稻规模化制种关键技术研究与产业化》（2008BAD93BO2）', '304', '20', '第二主持', '形成了多项三系杂交稻种子生产技术规程，为国家和公司杂交水稻制种基地的科学布局和杂交水稻种子安全、稳定生产打下了良好技术基础。探索了关键环节机械化制种技术，十二五规模化制种技术研究项目打下了良好的基础，', 1, NULL);
INSERT INTO `book_project` VALUES (215, 209, '国家高技术研究发展计划（863计划）', '《绿色超级稻新品种培育》', '64', '6', '项目经理', '为我国水稻生物技术基础研究成果的转化、规模化的基因组育种、集成技术育种等水稻生物技术产业化的发展提供了良好的范例。在政府政策扶持和引导下，以体制和机制创新为保障，对我国种业企业的研发体系建设和实力的提升，促进企业、院校协同联合，从功能基因发掘、育种资源和材料创制、绿色性状亲本的选育、杂交组合选配与测试、种子生产和农艺技术服务等环节实现学研产的有机结合，最终实现确保国家粮食安全目标有很好的示范作用，为构建中种公司水稻育种研发体系提供了最优的路径。', 1, NULL);
INSERT INTO `book_project` VALUES (216, 209, '国家转基因重大专项', '《转基因抗虫水稻中试与示范》（2012ZX08013003）', '394', '24', '主持人', '建成了2个转基因隔离场；在湖北、湖南、浙江、福建、海南、浙江等省地建有中试试验基地，筛选出4个以上抗虫水稻品种，转基因水稻亲本繁殖和种子生产技术进行了研究并形成了制种技术规程和安全生产基地，转基因水稻品种种子为商业化打下了基础；待批准上市即可快速规模化生产。', 1, NULL);
INSERT INTO `book_project` VALUES (217, 209, '科技部农业科技转化', '《优质高产杂交粳稻III优98的中试开发和出口创汇》', '50', '9', '主持人', '研究A23,R18亲本繁殖技术，III优98（MH2003）F1种子生产技术，高产栽培技术的研究与应用，出口糙米种子加工技术的研究，完成了该项目的各项指标，糙米种子成功出口。', 1, NULL);
INSERT INTO `book_project` VALUES (218, 209, '品种引进', '优质水稻“宜香3003”引进推广', '300', '30', '主持', '形成了高产制种技术规程，找准产品定位及适销区域，在长江上游和华南稻区进行推广种植，在云南省等重点市场种植达十五年。近十一年累计种植605万亩，中种绵阳公司该品种近三年仍累计销售近63.6万公斤，实现销售收入2804万元。', 1, '');
INSERT INTO `book_project` VALUES (219, 209, '国家科技支撑计划', '水稻生物技术商业化育种技术研究与示范（2014BAD01B03）', '700', '30', '项目骨干', '成功定位并转育新质源（CMS-FA）恢复基因、申请发明专利1项、审定组合1个（2次），国家区域试验生产试验1个组合、申请品种权保护35个，选育新不育系7个（其中3个通过技术鉴定），选育抗病新恢复系30多个，中间抗性材料200余份等系列成果。', 1, NULL);
INSERT INTO `book_project` VALUES (220, 91, '国家现代农业产业技术体系 ', '甜菜栽培生理岗位科学家团队', '350', '10', '团队成员', '发表论文8篇，申请地方专利1项', 1, NULL);
