INSERT INTO `book_project` VALUES (222, 121, '新型产品研发', '南方稻区粳稻种质创新与新品种选育', '500', '10', '项目经理', '1、2个品种【中粳616（原名中粳174）、中粳优9313】审定；2、2个不育系（中种19A、中种1038A）通过技术鉴定；3、 17个（中种1038A、中种19A、中种恢181、中种恢362、中粳恢36、中粳恢103、中粳恢183、中种恢9313、中粳恢201、中粳652、中粳优9313、中粳174、中种粳6227、中种粳1503、中种粳1514、中种粳1553、中种粳1555）品种获品种权保护受理公告；4、创制新种质82份；', 1, NULL);
