INSERT INTO `book_project` VALUES (225, 120, '新型产品研发', '绿色超级稻新品种培育', '186', '8', '子项目主持', '审定1个水稻品种；鉴定1个两系不育系；推广绿色超级稻品种3855万亩。', 1, NULL);
INSERT INTO `book_project` VALUES (226, 170, '中种自主项目', '作物品质分析技术方法与标准体系的构建与应用', '200', '7', '项目经理', '研发建立了26项水稻品质指标检测技术体系，主编《作物品质检测技术标准系列：稻米品质检测分析方法》。包括水稻国标和部标常规品质检测指标、蒸煮食味品质、营养品质、安全品质等，在国内同类实验室中水稻检测项目最多最齐全，检测通量和检测技术能力处于国内领先。还搭建了小麦、向日葵、番茄、西瓜等多种作物主要品质指标检测新体系。', 1, NULL);
INSERT INTO `book_project` VALUES (227, 126, '新型产品研发', '南方稻区粳稻种质创新与新品种选育', '500', '14', '项目参与者', '1、作为主要完成人（排名第3）选育中种公司第一个全自主知识产权杂交粳稻品种“中粳优9313” 通过省级审定；该成果主要亮点：（1）、品质优，整精米率高，多出米，达部颁优质2级；（2）抗性好，少打农药，更绿色，中抗稻瘟病（MR)，抗（R）纹枯病，抗瘟曲病；（3）高产稳产，抗逆性强，懒人稻，两年河南省区试比对照增产达8.55%，居参试组第1名；2、作为主要完成人（排名第3）选育中种公司第一个全自主知识产权常规粳稻品种“中粳616”通过国家审定；该成果主要亮点：（1）中抗稻瘟病、少打农药；（2）品质达国标3级、', 1, NULL);
