INSERT INTO `book_project` VALUES (242, 135, '基础研发', '水稻功能基因组组学平台及应用', '30', '9', '主要参与人', '利用抗病虫表型鉴定技术提前协助育种家淘汰抗性差的材料，提升育种效率。同时新搭建3种作物（番茄、西瓜、向日葵）6种病害（西瓜果腐病、西瓜枯萎病、番茄黄萎病、番茄枯萎病、向日葵黑斑病、向日葵黄萎病）室内鉴定体系。', 1, '');
