INSERT INTO `book_project` VALUES (261, 154, '产品研发', '标记开发和应用项目', '10', '7', '主要执行人', '1、熟悉作物育种的基本理论知识，熟悉利用分子标记技术辅助育种，提高育种效率，具体负责开发功能标记检测体系，截止目前成熟的功能标记453个，成功率为90%，OA芯片4套该项技术应用每年平均占OA平台检测量的90%；\n2、熟练SSR标记检测、OA检测、芯片检测流程以及注意事项，主用应用于育种材料背景和目标基因检测，三项技术为分子辅助育种的核心技术；\n3、建立转基因检测体系，包含以国家农业部标准为基础的TaqMan检测体系和以欧盟检测标准为基础的SYBR Green检测方法，应用于育种材料的转基因检测, 该项技', 1, '');
INSERT INTO `book_project` VALUES (262, 154, '产品研发', '平行扩增项目', '10', '7', '主要执行人', '1、搜集整理平行扩增测序资料，做测序技术的可行性分析报告；\n2、主要负责平行扩增项目思路拟定，进度跟踪以及与合作单位信息交流、实验方案设计；\n3、现已完成第一轮测试，与预期吻合度高达99%，即将成为新一代分子辅助育种检测技术；\n', 1, '');
INSERT INTO `book_project` VALUES (263, 154, '产品研发', '作物菜单扩增项目', '15', '7', '主要执行人', '1、熟悉科研项目研发流程，进行作物菜单扩增项目，开发番茄、西瓜、向日葵、小麦真实性和纯度鉴定体系；\n2、与内部单位经作部、番茄育种部多次合作完成技术服务项目，现持续合作中；\n', 1, '');
INSERT INTO `book_project` VALUES (264, 154, '产品研发', '利用育种芯片培育水稻特优新品种', '20', '12', '主要执行人', '具体负责提供、保障合适的温室条件进行项目相关实验', 1, '');
