INSERT INTO `book_project` VALUES (267, 154, '产品研发', '全面质量管理项目', '20', '7', '主要执行人', '1、确定分子标记检测质量管理方案，方案从无到有，现在正在使用，保证分子组检测有序进行；\n2、建立技术平台部三级种子库的管理流程和管理制度，该管理制度从无到有，现在依据我制作的方案执行；\n3、撰写分子标记组卫生管理制度并监督工作人员履行，该管理制度从无到有，现在依据我制作的方案执行；\n', 1, '');
