INSERT INTO `book_project` VALUES (277, 123, '新型产品研发', '南方稻区粳稻种质创新与新品种选育', '500', '14', '项目参与者', '1、作为主要完成人（排名第2）选育水稻品种2个。（一）中粳优9313：该品种为中种公司第一个全自主知识产权的杂交粳稻品种，通过省级审定；该成果主要亮点：（1）、品质优，整精米率高，多出米，达部颁优质2级；（2）抗性好，少打农药，更绿色，中抗稻瘟病（MR)，抗（R）纹枯病，抗瘟曲病；（3）高产稳产，抗逆性强，懒人稻，两年河南省区试比对照增产达8.55%，居参试组第1名。（二）中粳616：该品种为中种公司第一个全自主知识产权的常规粳稻品种，通过国家审定；该成果主要亮点：（1）中抗稻瘟病、少打农药；（2）品质达', 1, NULL);
