INSERT INTO `book_project` VALUES (448, 218, '大田应用技术', '新天拉美部古巴项目', '100', '5', '1、定期组织召开生产技术会议，解决实际生产中出现的问题\n2、管理人员和技术骨干的团队培养、梯队建设和考核\n3、协调和飞机公司、水利公司、稻米协会、电力公司、粮食进出口公司及其他相关部门的关系', '通过召开生产技术会议，解决实际生产中出现的问题，赢得当地农户一致好评', 1, '');
INSERT INTO `book_project` VALUES (449, 218, '大田应用技术', '菊苣新品种的选育', '200', '6', '主持：\n原料种植及技术指导服务\n原料收购\n菊苣新品种的选育', '昌吉州菊苣栽培管理技术规程\n', 1, '');
INSERT INTO `book_project` VALUES (450, 221, '新型应用技术研究', '熏蒸剂对土壤硝化和反硝化的影响', '400', '10', '项目经理', '阐明了用于土壤消毒的熏蒸剂对土壤氮肥硝化和反硝化的关键影响，对土壤消毒后的用肥技术起到关键指导意义，大量节省了农户氮肥投入。', 1, '');
INSERT INTO `book_project` VALUES (451, 221, '新型产品研发应用', '糠醛作物土壤熏蒸剂的应用技术', '100', '8', '项目经理', '阐明了糠醛（新型土壤消毒药剂）对土壤根结线虫和低等真菌病害的良好防效，对比其他土壤熏蒸药剂，施用方法更加灵活，大幅降低农户单亩药剂投入水平。', 1, '');
INSERT INTO `book_project` VALUES (452, 222, '应用技术', '玉米水肥一体化产研销项目 ', '23', '10', '项目经理', '1、乌拉特前旗实现技术推广面积1.6万亩，通辽实现技术推广面积1.5万亩。\n2、完成两个区域的优化试验布置共230亩。 \n', 1, '');
INSERT INTO `book_project` VALUES (453, 222, '应用技术', '玉米籽粒呕吐毒素含量降低关键技术', '27', '15', '项目经理', '完成春玉米巴彦和梨树各22个处理的试验布置；\n夏玉米区确定了四种的种衣剂类型，其中有三种生物种衣剂，验证绿色防治的效果。', 1, '');
INSERT INTO `book_project` VALUES (454, 222, '应用技术', '玉米籽粒容重提升关键技术 ', '25', '13', '项目经理', '完成春玉米区通辽20个处理试验和梨树17个处理试验布置。 \n确定黄淮海夏玉米试验方案初步对接确认，正在试验材料准备选出两种不同的核心母粒配方，进行效果和成本的验证。以核心母粒为底肥加后期叶面肥处理为主。\n', 1, '');
INSERT INTO `book_project` VALUES (455, 223, '新型产品开发', '新型大豆化肥研发', '200', '10', '项目经理', '植保产品升级优化项目，组织技术，市场完成产品的重新定位，并对产品组合进行优化。', 1, '');
INSERT INTO `book_project` VALUES (456, 226, '科研项目', '国家防沙治沙资助项目“农牧交错地区防沙治沙技术示范区”（FS2000-03）和河北省科学技术研究与发展计划项目“冀西北农牧交错区水资源综合利用与保护体系”（03220134D）', '300', '7', '课题参与人', '研究发表不同耕作模式对土壤侵蚀及作物生产影响及不同植被的土壤水分动态变化研究', 1, '');
