INSERT INTO `book_project` VALUES (468, 232, '新型产品研发与应用技术探索', '新型Strobilurin杀菌混剂开发与应用技术深入研究\n', '400', '6', '项目经理', '项目开发的5个含烯肟菌胺杀菌剂混剂，均已启动登记，目前已有3个产品获取农药登记证并上市', 1, NULL);
INSERT INTO `book_project` VALUES (469, 232, '新型产品研发与应用技术探索', '氟吗啉后专利期新剂型、新混剂应用技术深入研究与开发', '230', '6', '独立承担子课题', '项目开发的5个含氟吗啉杀菌剂混剂，均已启动登记，目前已有3个产品获取农药登记证并上市', 1, NULL);
INSERT INTO `book_project` VALUES (470, 233, '国家自然科学基金', '我国典型红壤区域潜在酸化过程及机制', '25', '5', '项目负责人', '明确红壤潜在酸化的主要过程及主要过程指标的演变趋势，为我国红壤酸化防治提供科技支撑。', 1, NULL);
INSERT INTO `book_project` VALUES (471, 233, '国家重点基础发展计划（973计划）', '主要类型区红壤酸化的机理、驱动因子及时空演变规律，项目编号2014CB441001', '720', '12', '项目骨干', '明确了湖南等典型红壤区域的土壤酸化的主要影响因素及关键影响因素的贡献率，红壤酸化的时空演变规律。', 1, NULL);
INSERT INTO `book_project` VALUES (472, 233, '国家重点研发计划', '南方特色经济作物双减技术及产品研发', '76', '11', '项目骨干', '', 1, NULL);
INSERT INTO `book_project` VALUES (473, 233, '科技投入', '具备土壤改良功能的新产品研发及长期定位试验', '60', '8', '项目负责人', '开发具备酸化土壤和盐碱地的改良功能的新产品，分别提出酸化土壤和盐碱地无机型改良剂配方2个，造粒工艺2套，改良技术方案2套，达到节本，增产，提升作物品质的作用。', 1, NULL);
INSERT INTO `book_project` VALUES (474, 236, '农业应用技术', '长江流域精量机直播稳质增产集成技术', '36', '16', '项目经理', '按计划完成试验田整地、扎田埂、浸种、施肥；\n完成苗期水肥管理及病虫防治；\n优化智能测报的系统试验方案；\n 规范试验调查方法及数据记载表格；\n', 1, '');
INSERT INTO `book_project` VALUES (475, 236, '农业应用技术', '柑橘提糖降酸品质提升综合技术', '45', '12', '项目经理', '湖南、湖北试验任务进行顺利；\n湖南、湖北均完成试验挂牌及插地牌布置；\n', 1, '');
