INSERT INTO `book_project` VALUES (480, 41, '公益性行业专项', '公益性行业（农业）科研专项经费项目（201303102）', '200', '8', '项目主要负责人', '优质稻百亩高产示范片超800公斤验收。杂交稻超高产攻关超900公斤验收。', 1, '');
INSERT INTO `book_project` VALUES (481, 87, '新产品研发', '中国科学院 《新型肥料研究与开发项目》', '100', '8', '新型肥料产业化开发课题，缓控释肥料实验室和大田实验示范开发等田间试验，长效复合肥新产品的产品研制和田间试验、数据分析、总结报告等\n', '\"2009年 中科院沈阳生态所 科技进步二等  长效缓释肥料研制与应用\n2007年 辽宁省科技进步一等奖           长效复合肥添加剂\n2006年 沈阳市人民政府科技进步一等奖   长效复合肥添加剂\n\n专利：一种氮素损失控制剂及其制备。发明人：石元亮;孙爱文;孙桂芳\n\"\n', 1, '');
INSERT INTO `book_project` VALUES (482, 87, '产业研究', '参与《中国磷肥竞争力研究》、《钾肥及钾资源发展战略研究》', '30', '5', '\"组织撰写《中国化工行业及肥料产业发展战略研究》中化化肥发展战略报告；\n负责复合肥新产品的配方开发、技术和项目培训等\n\"\n', '\"完成项目的专业报告；\n完成《有机无机复混肥》、《中化智胜多元素鏊合肥》 两个化肥产品的专利申请\n\"\n', 1, NULL);
INSERT INTO `book_project` VALUES (483, 87, '产业研究', '农业部《粮食与化肥产业安全》项目', '100', '6', '项目团队的主要研究人员之一，参加全国农村农户的入户调研和项目报告撰写工作\n', '完成《我国粮肥比价与粮食生产的关系研究》 博士论文，发表《中国肥粮比价及调控策略初探》在《经济研究参考》.第43期,23-30等\n', 1, '');
INSERT INTO `book_project` VALUES (484, 87, '纵向课题', '北京市农村精神文明建设情况调查', '10', '4', '报告咨询，调研设计等，参加项目报告撰写工作\n', ' 首都文明办、北京市农委， 提供项目报告，政府决策参考\n', 1, NULL);
INSERT INTO `book_project` VALUES (485, 87, '纵向课题', '北京市农村精神文明建设评价指标体系研究', '5', '4', '报告咨询，调研设计等，参加项目报告撰写工作\n', ' 首都精神文明建设委员会办公室， 提供项目报告，政府决策参考\n', 1, NULL);
INSERT INTO `book_project` VALUES (486, 87, '纵向课题', '北京市“十三五”时期城乡一体化发展规划中期评估', '10', '5', '报告咨询，调研设计等，参加项目报告撰写工作\n', '北京市农村工作委员会，已提供项目报告，政府决策参考\n', 1, NULL);
INSERT INTO `book_project` VALUES (487, 87, '中化集团创新项目', '中化集团重大科技项目《蒙东苜蓿草提质增产项目》项目', '278', '17', '参加项目的申报、答辩和集团的对接工作，主要负责苜蓿草种植技术和营养方案制定及大田试验技术推广\n', '\"截至2018年12月31日，自建农场2130亩试验示范，完成土壤障碍因子、苜蓿根腐病防治二次试验， 水肥一体化试验，显著提升苜蓿株高、分蘖，整体生物量增加15.2%，蛋白含量提高5% \n\"\n', 1, NULL);
INSERT INTO `book_project` VALUES (488, 87, '中化集团创新项目', '中化集团重大科技项目《农业事业部MAP业务模式创新》项目', '900', '31', 'MAP农场技术集成与种植技术方案支持，内部农艺师团队的技术培训和田间实操培训\n', '截至2018年12月31日，全国41家MAP技术服务中心已开展生产的示范农场共46个，经过试验和技术集成形成18套标准化种植技术方案\n\n', 1, NULL);
INSERT INTO `book_project` VALUES (489, 87, '中化农业创新项目', '中化农业事业部创新项目2-1.1MAP线下服务（大田）', '20', '8', '项目总监，主要负责作物技术支持，作物和生产专家的管理方案\n', '围绕“种好作物”和示范农场建设，形成《专家体系建设方案》、《TD工作手册》 《大田MAP应用技术人才发展建设方案》，组建总部+省区作物专家 23人，开展“田园课堂”8期、农户培训185场，完成内部应用人才评聘工作。\n', 1, NULL);
INSERT INTO `book_project` VALUES (490, 87, '应用技术中心科研项目', '《玉米籽粒容重提升关键技术》', '29', '16', 'MAP粮作技术指导和黄淮海区域试验设置总协调\n', '2019年1-12月，形成综合应用技术及产品包，项目实施中\n', 1, NULL);
