INSERT INTO `book_project` VALUES (515, 184, '江苏分公司', '螯合肥产品示范田建设', '1', '3', '设计示范田建设方案，过程检测与指标检测，测产及投入产出分析，总结分析与收集信息', '在同等肥料投入量,同等田间管理的条件下，螯合肥示范田比对照田仅多投入17元。但是螯合肥示范田平均亩产量为825kg,而对照田平均亩产量745kg，相差80kg。由于时间紧迫，种植户即收即卖，稻谷水分较大，达到29%水平，因此收购价格较低，仅为2.16元/kg。这样的情况下，螯合肥示范田亩产值约1782元，对照组1609元，示范田每亩增收173元！\n', 1, '');
