INSERT INTO `book_project` VALUES (552, 229, '调研项目', '“力作”产品前期探索及上市活动  ', '100', '20', ' 探索氟啶虫酰胺在中国地区的活性及抗性问题，明确靶标，确定合适的使用靶标及对应的使用计量。明确对照产品的效果，明确力作和对照产品的优势，并确定市场方向。组织上市会并在上市会上宣讲力作的使用技术。', '成功发布', 1, '');
