INSERT INTO `book_project` VALUES (581, 55, '推广', '水稻精量穴直播技术集成', '10', '6', '项目技术实施', '水稻种肥药同播与配套缓释肥料结合，以及配套生产技术开发，稳定品质达到国标优质稻3级以上，增产10%，轻简化节省用工10元/亩。', 1, '');
INSERT INTO `book_project` VALUES (582, 40, '溃疡病的综合防治', '溃疡病的综合防治', '5', '6', '项目主持人', '在坤水农业猕猴桃基地指导实施的猕猴桃溃疡病的综合防治方案，通过合理施肥，增强猕猴桃春季新根快速生长，健壮树势，严格控制全年氮肥施用量，辅助化学预防（春雷霉素、氢氧化铜）溃疡病，合理负载保存树体综合实力。在邛崃火井镇、水口镇、南宝山镇高海拔区域达到了很好的效果。坤水农业全园600亩猕猴桃，经过2018年一年多的示范推广，2019年园区溃疡病发病率为6%。与周边区域猕猴桃基地平均发病率20%相比，为坤水农业猕猴桃基地挽回经济损失50万元。', 1, '');
INSERT INTO `book_project` VALUES (583, 57, '产品研发', '掺混肥料潮解攻关', '20', '4', '原材料配伍筛选试验', '通过原材料配方的调整和优化，解决了掺混肥料潮解的问题，为公司每年节省商务费用80万元。', 1, '');
INSERT INTO `book_project` VALUES (584, 57, '技术工艺研发', '有机-无机复混肥料“粉化”攻关', '30', '8', '参与项目“粉化”中白色粉末的成分分析、不同尿素添加量的粉化试验（小试）', '2004年3月，解决了公司一年多存在的有机-无机复混肥料粉化的问题，减少商务损失近70万元/年。', 1, '');
INSERT INTO `book_project` VALUES (585, 57, '产品研发', '纤维类有机肥造粒攻关', '10', '4', '主持项目，有机肥造粒粘结剂的筛选和寻找，成粒性试验的小试工作', '2007年10月后，中化解决了纤维类有机肥料成粒的难题，2007年-2017年，均使用同类型的粘结材料。销售产品10万余吨，创造毛利2000余万元。', 1, '');
