INSERT INTO `book_project` VALUES (604, 137, '自主项目', '作物品质分析技术方法与标准体系的构建与应用', '200', '7', '参与', '研发建立了26项水稻品质指标检测技术体系，主编《作物品质检测技术标准系列：稻米品质检测分析方法》。包括水稻国标和部标常规品质检测指标、蒸煮食味品质、营养品质、安全品质等，在国内同类实验室中水稻检测项目最多最齐全，检测通量和检测技术能力处于国内领先。还搭建了小麦、向日葵、番茄、西瓜等多种作物主要品质指标检测新体系。', 1, '');
